import React from 'react';
import './App.css';
import PropTypes from 'prop-types';

const propTypes = {
  todo: PropTypes.shape({}),
};
const defaultProps = {
  todo: [
    {
      title:1,
      completed:true,
    }
  ],
};

const App = (props) => {

  const main = (
    <section className="main">
      <input
        id="toggle-all"
        className="toggle-all"
        type="checkbox"
      />
      <label
        htmlFor="toggle-all"
      />
      <ul className="todo-list">
        <li>
          <div className="view">
            <input
              className="toggle"
              type="checkbox"
              checked={props.todo.completed}
            />
            <label>
              {props.todo.title}
            </label>
          </div>
          test
        </li>
      </ul>
    </section>
  );
  return (
    <div>
      <header className="header">
        <h1>todos</h1>
      </header>
      {main}
    </div>
  );
}

App.propTypes = propTypes;
App.defaultProps = defaultProps;

export default App;
